import React from 'react';
import logo from './svg/logo.svg';

function Home(){
    return(
        <div>
            <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
            Welcome!
            </p>
            <a
                className="App-link"
                href="https://google.com"
                target="_blank"
                rel="noopener noreferrer"
            >
            Link
            </a>
        </header>
      </div>
    )
}

export default Home;
